// src/pages/instructor/InstructorDetails.js
import React from "react";
import { useParams } from "react-router-dom";
import instructorData from "../../data/instructorDetails.json";

function InstructorDetails() {
  const { name } = useParams();

  // Convert instructor name from URL slug format to match data
  const instructor = instructorData.find(
    (item) =>
      item.name.toLowerCase().replace(/\s+/g, "-") === name.toLowerCase()
  );

  if (!instructor) {
    return (
      <div className="container py-5">
        <h2 className="text-center">Instructor not found</h2>
      </div>
    );
  }

  return (
    <div className="container py-5">
      <div className="row align-items-center mb-4">
        <div className="col-md-4 text-center">
          <img
            src={`${process.env.PUBLIC_URL}/assets/images/${instructor.image}`}
            alt={instructor.name}
            className="img-fluid rounded-circle"
            style={{ maxWidth: "250px" }}
          />
        </div>
        <div className="col-md-8">
          <h2>{instructor.name}</h2>
          <p className="text-muted">{instructor.title}</p>
          <p>{instructor.bio}</p>
          <div className="mt-3">
            {instructor.socialLinks && (
              <ul className="list-inline">
                {instructor.socialLinks.facebook && (
                  <li className="list-inline-item me-3">
                    <a href={instructor.socialLinks.facebook} target="_blank" rel="noreferrer">
                      <i className="fab fa-facebook-f"></i>
                    </a>
                  </li>
                )}
                {instructor.socialLinks.twitter && (
                  <li className="list-inline-item me-3">
                    <a href={instructor.socialLinks.twitter} target="_blank" rel="noreferrer">
                      <i className="fab fa-twitter"></i>
                    </a>
                  </li>
                )}
                {instructor.socialLinks.linkedin && (
                  <li className="list-inline-item me-3">
                    <a href={instructor.socialLinks.linkedin} target="_blank" rel="noreferrer">
                      <i className="fab fa-linkedin-in"></i>
                    </a>
                  </li>
                )}
                {instructor.socialLinks.youtube && (
                  <li className="list-inline-item me-3">
                    <a href={instructor.socialLinks.youtube} target="_blank" rel="noreferrer">
                      <i className="fab fa-youtube"></i>
                    </a>
                  </li>
                )}
              </ul>
            )}
          </div>
        </div>
      </div>

      <div className="row mb-4">
        <div className="col-md-6">
          <h4>Qualifications</h4>
          <ul>
            {instructor.qualifications.map((q, index) => (
              <li key={index}>{q.degree} - {q.school}</li>
            ))}
          </ul>
        </div>
        <div className="col-md-6">
          <h4>Experience</h4>
          <ul>
            {instructor.experience.map((e, index) => (
              <li key={index}>{e.place} ({e.duration})</li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
}

export default InstructorDetails;
